  // Remove espaços, parênteses, traços, etc.
  telefone = telefone.replace(/\D/g, "");

  // Verifica se já começa com 55
  if (!telefone.startsWith("55")) {
    telefone = "55" + telefone;
  }

  // Garante que tenha o +
  if (!telefone.startsWith("+")) {
    telefone = "+" + telefone;
  }

  item.json.telefone = telefone;
  return item;
});

